import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Bootstrap, Button } from 'react-bootstrap';

import './BackButton.css';

const BackButton = (props) => (
    <div className="backButton">
      <Button>Back</Button>
    </div>
);


export default BackButton;
